import { Navigate} from "react-router-dom";
import useAuth from "../auth/useAuth";

export default function PublicRoute({Type, Component}) {

    const {user} = useAuth();

    if(Type== "public") if(user) return <Navigate to='/projects' /> 

    else if(Type== "private") if(!user) return <Navigate to='/login' />

    return (
        Component
    )
}
